import "./App.css";
import React, { useState } from "react";
import { getUserToken } from "./actions/getUserToken";
import { getTrades } from "./helpers/getTrades";


function App() {
    const [contact, setContact] = useState({
        fName: "",
        lName: "",
        email: "",
    });

    // setUserToken("grego", "V4711gda")
    // console.log(getTrades());

    const url = process.env.BACK_END_URL || "http://localhost:8000";


  const trades = []
  getUserToken("grego", "V4711gda").then((r)=>{getTrades(r.token).then((data)=>{
    for (let i = 0; i < data.length; i++){
      trades[i] = data[i]
    }
  });});

  console.log(trades);






    function handleChange(event) {
        const { name, value } = event.target;

        setContact((prevValue) => ({ ...prevValue, [name]: value }));
    }
    return (
        <div className="container">
            <h1>
                Hello {contact.fName} {contact.lName}
            </h1>
            <p>{contact.email}</p>
            <form>
                <input
                    onChange={handleChange}
                    name="fName"
                    value={contact.fName}
                    placeholder="First Name"
                />
                <input
                    onChange={handleChange}
                    name="lName"
                    value={contact.lName}
                    placeholder="Last Name"
                />
                <input
                    onChange={handleChange}
                    name="email"
                    value={contact.email}
                    placeholder="Email"
                />
                <button>Submit</button>
            </form>
        </div>
    );
}

export default App;
